description:
Вниманию покупателей предлагается превосходный автомобиль Range Rover Velar, который  удостоен награды «Автомобильный дизайн года» (2018) по версии World Car Awards. Выразительные пропорции, выдвигающиеся ручки дверей и встроенный задний спойлер, выделяют его среди конкурентов, а элементы отделки кузова и интерьера, делают облик данного автомобиля по-настоящему неотразимым. Если вы искали роскошный и мощный внедорожник с высокими ходовыми характеристиками — продолжать поиски больше не придется.
Представленный вашему вниманию автомобиль, имеет следующую комплектацию:
- Безключевой доступ;
- Аудиосистема MERIDIAN SURROUND;
- Мультимедиа TOUCH PRO DUO;
- InControl;
- Навигация;
- Система контроля давления в шинах;
- Камера заднего вида с омывателем;
- Камера 360°
- Дверь багажника с электроприводом;
- Проекция на лобовое стекло;
- Матричные фары с интеллектуальным переключением ближний/дальний;
- Память сидений и зеркал;
- Регулируемая подсветка интерьера
- Электропривод руля;
- Виртуальная панель инструментов TFT дисплей 12,3 дюйма;
- Контроль за полосой движения;
- Отделка сидений перфорированной кожей;

Пробег данного автомобиля составляет 14.300 км. Полный комплект ключей и документов. Юридически «чистая» история и бережная эксплуатация, а так же хранение в подземном, тёплом паркинге - являются неоспоримыми основаниями, для выбора данного Range Rover Velar.
